import code from '../../../assets/img/icons/landing/code.svg'
import pages from "../../../assets/img/icons/landing/pages.svg"
import draw from '../../../assets/img/icons/landing/draw.svg'





export const IconSection = () => {

    const iconFeatures = [
        [
            {
                src: code,
                title: 'Structured Code',
                span: 'For an optimized dev experience',
            },
            {
                src: pages,
                title: '43 Prebuilt Pages',
                span: 'To help you kickstart your project',
            }, {
                src: draw,
                title: 'Illustrations',
                span: 'Included as svg and png files',
            }], [
            {
                src: code,
                title: 'Structured Code',
                span: 'For an optimized dev experience',
            },
            {
                src: pages,
                title: '43 Prebuilt Pages',
                span: 'To help you kickstart your project',
            }, {
                src: draw,
                title: 'Illustrations',
                span: 'Included as svg and png files',
            }], [
            {
                src: code,
                title: 'Structured Code',
                span: 'For an optimized dev experience',
            },
            {
                src: pages,
                title: '43 Prebuilt Pages',
                span: 'To help you kickstart your project',
            }, {
                src: draw,
                title: 'Illustrations',
                span: 'Included as svg and png files',
            }], [
            {
                src: code,
                title: 'Structured Code',
                span: 'For an optimized dev experience',
            },
            {
                src: pages,
                title: '43 Prebuilt Pages',
                span: 'To help you kickstart your project',
            }, {
                src: draw,
                title: 'Illustrations',
                span: 'Included as svg and png files',
            }]]




    return (
        <div class="section landing-wrapper icons-section">
            <div class="container">

                {iconFeatures.map(iconRow => (
                    <div id="icon-features" class="columns">
                        <div class="column is-hidden-mobile"></div>
                        {iconRow.map(icon => (
                            <div class="column is-3">
                                <div class="landing-icon-box">
                                    <img src={icon.src} alt="" />
                                    <h3>{icon.title}</h3>
                                    <p>{icon.span}</p>
                                </div>
                            </div>
                            ))}
                            
                            <div class="column is-hidden-mobile"></div>
                        </div>
                        )
                        )}
                       
                    </div>
        </div>

    )
}
